since: 20200607-144723-74889cd4 If you find that you're often searching for the same things then you may wish to assign a keybinding to trigger that search. For example, if you find that you're frequently running git log and then reaching for your mouse to copy and paste a relevant git commit hash then you might like this: local wezterm = require 'wezterm';
return { keys = { -- search for things that look like git hashes {key="H", mods="SHIFT|CTRL", action=wezterm.action{Search={Regex="[a-f0-9]{6,}"}}}, },
} With that in your config you can now: CTRL-SHIFT-H to highlight all the git hashes and select the closest one to the bottom of the screen. Use ENTER/CTRL-N/CTRL-P to cycle through the git hashes CTRL-SHIFT-C to copy Escape CTRL-SHIFT-V (or SHIFT-Insert) to Paste without needing to reach for your mouse. See the Search action docs for more information on using the Search action.

